import React, { useState } from "react";
import Logo from "../../images/logo.png";
import styles from "./Navbar.module.css";
import {
  AppBar,
  Box,
  Toolbar,
  Typography,
  Drawer,
  Button,
  List,
  Divider,
  ListItem,
  ListItemIcon,
  ListItemText,
} from "@material-ui/core";
import { Link } from "react-router-dom";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import MenuIcon from "@material-ui/icons/Menu";

const useStyles = makeStyles({
  list: {
    width: 250,
  },
  fullList: {
    width: "auto",
  },
});

const Navbar = () => {
  // let [navState, setNavState] = useState(false);

  // const showNav = () => {
  //   setNavState(!navState);
  // };
  const classes = useStyles();
  const [state, setState] = React.useState({ left: false });
  const toggleDrawer = (anchor, open) => (event) => {
    if (
      event.type === "keydown" &&
      (event.key === "Tab" || event.key === "Shift")
    ) {
      return;
    }
    setState({ ...state, [anchor]: open });
  };

  const list = (anchor) => (
    <div
      className={clsx(classes.list, {
        [classes.fullList]: anchor === "top" || anchor === "bottom",
      })}
      role="presentation"
      onClick={toggleDrawer(anchor, false)}
      onKeyDown={toggleDrawer(anchor, false)}
    >
      <List>
        {["Home", "Portfolio", "Start A Project"].map((text, index) => (
          <ListItem button key={text}>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
      <Divider />
    </div>
  );
  return (
    <div>
      <AppBar className={styles.mainContainer}>
        <Toolbar className={styles.container}>
          <Box component="div" className={styles.toggleContainer}>
            <Link to="/">
              <img src={Logo} alt={"portfolio Logo"} className={styles.logo} />
            </Link>
            <div className={styles.toggle}>
              <React.Fragment>
                <Button onClick={toggleDrawer("left", true)}>
                  <MenuIcon />
                </Button>
                <Drawer
                  anchor={"left"}
                  open={state["left"]}
                  onClose={toggleDrawer("left", false)}
                >
                  {list("left")}
                </Drawer>
              </React.Fragment>
              {/* <div className={styles.toggleElement} />
              <div className={styles.toggleElement} />
              <div className={styles.toggleElement} /> */}
            </div>
          </Box>
          <Box
            component="div"
            className={
              navState ? styles.navLinkContainerActive : styles.navLinkContainer
            }
          >
            <Typography className={styles.navLinks} variant="h6">
              <Link to="/">Home</Link>
            </Typography>
            <Typography className={styles.navLinks} variant="h6">
              <Link to="/portfolio">Portfolio</Link>
            </Typography>
            <Typography className={styles.projectLink} variant="h6">
              <Link to="/contact">Start A Project</Link>
            </Typography>
          </Box>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default Navbar;
